import React from 'react'
import {Link} from "react-router-dom";

const CourseEditor = ({message, props}) =>
    <div>
        <h2>
            <link to="/courses/table">
                <i className="fas fa-arrow-left"></i>
            </link>
            Course Editor{message}
            <i className="fas fa-times float-right"></i>
        </h2>
    </div>

